  return (
    <div>
      <Navbar />
      <main className="container mx-auto mt-8 p-4">
        {/* Your page content goes here */}
        <h1 className="text-3xl font-bold">Welcome to Your Website</h1>
        <p className="mt-4">This is your homepage content.</p>
      </main>
      <Footer />
    </div>
  );
}

export default App;
